import { IGQLType, IGQLField, ISDL } from 'prisma-datamodel';
export default class ModelNameNormalizer {
    normalize(model: ISDL): void;
    protected assignName(obj: IGQLType | IGQLField, newName: string): void;
    protected normalizeType(type: IGQLType): void;
    protected normalizeField(field: IGQLField, parentType: IGQLType): void;
}
